const initialState = {
    paymentData : [],
    incomeData : [],
    expenseData : [],
    categoryData : [],
    apiRequest : {
        message : '',
        status : '',
        apiInProcess : false
    }
};

const CategoryReducer  = ( state = initialState , action ) => {
    return {
        state
    }
};

export default CategoryReducer;
